import React from "react";
import { ResponsiveBullet } from '@nivo/bullet'


const data = [
  {
    "id": "temp.",
    "ranges": [
      24,
      76,
      15,
      0,
      120
    ],
    "measures": [
      67
    ],
    "markers": [
      104
    ]
  },
  {
    "id": "power",
    "ranges": [
      1.485197749172159,
      0.5011233820742649,
      1.1198396920147258,
      0,
      2
    ],
    "measures": [
      0.5351152477769373,
      1.3942119759646547
    ],
    "markers": [
      1.5954072649410747
    ]
  },
  {
    "id": "volume",
    "ranges": [
      24,
      14,
      2,
      37,
      5,
      14,
      0,
      60
    ],
    "measures": [
      45
    ],
    "markers": [
      50
    ]
  },
  {
    "id": "cost",
    "ranges": [
      306297,
      78061,
      284069,
      0,
      500000
    ],
    "measures": [
      61257,
      407949
    ],
    "markers": [
      334114
    ]
  },
  {
    "id": "revenue",
    "ranges": [
      2,
      6,
      3,
      0,
      13
    ],
    "measures": [
      5
    ],
    "markers": [
      8.623889864512423,
      10.58183542953735
    ]
  }
]


function MyResponsiveBullet(){
  return (
    <ResponsiveBullet
        data={data}
        margin={{ top: 50, right: 90, bottom: 50, left: 90 }}
        spacing={46}
        titleAlign="start"
        titleOffsetX={-70}
        measureSize={0.2}
        rangeColors="nivo"
        animate={true}
        motionStiffness={90}
        motionDamping={12}
    />
  )
}

export default MyResponsiveBullet;
